To end a C program, you typically use the `exit()` function from the standard C library. This function terminates the execution of the program and returns control to the operating system. Here's how you can use it:

```c
#include <stdlib.h>

int main() {
    // Your code here...

    // End the program with a specific exit status
    exit(0);  // Exit with success status (0)
    // Or exit with an error status
    // exit(1); // Exit with error status (non-zero value)

    return 0; // This line is not necessary when using 'exit'
}
```

In the example above, `exit(0)` indicates that the program ended successfully. If you want to indicate an error or failure, you might use `exit(1)` or any other non-zero value.

Remember, once `exit()` is called, the program will terminate immediately, and no further code in the current function or any subsequent functions will be executed. It's important to ensure that all necessary cleanup has been done before calling `exit()`.
